pragma solidity 0.4.21;


contract RockPaperScissors {

    address public owner;

    enum State {Created, BettingEnd, Revealed, End}
    State state;

    struct Player {
        bytes32 choose;
        bool revealed;
        uint8 score;
        uint256 balance;
    }

    struct Game {
        uint256 amount;
        uint256 end;
        Player[2] players;
        State state;
    }

    mapping(bytes32 => Game) games;

    function RockPaperScissors() public {
        owner = msg.sender;
    }

    function startGame(bytes32 id, uint256 _amount, uint256 _end)
        public
        returns (bool)
    {
        require(_amount > 0);
        require(id != 0x0);
        require(_end > block.number);
        require(games[id].end == 0);

        games[id].amount = _amount;
        games[id].end = _end;
        games[id].state = State.Created;
        return true;
    }

    function getGame(bytes32 id)
        public
        view
        returns (uint256, uint256, State)
    {
        Game memory game = games[id];
        return(game.amount, game.end, game.state);
    }

